(defn delete-all-game-events
        []
   (with-client client
   (doseq [item (scan "Game_Event_Table" {})]
   (delete-item "Game_Event_Table" (create-key (:gameId item) (:clockUuid item))))
   (is (empty? (scan "Game_Event_Table" {}))))
)

